import React from 'react';
import {Payload} from './components/Payload';
import {LaunchImage} from './components/LaunchImage';
import Moment from 'moment';
import "./styles.scss";

//{img, title, date, desc, payload}
export class Launch extends React.Component{
    constructor(props){
        super(props);
        this.state={
            img: props.img,
            title: props.title,
            date: props.date,
            desc: props.desc,
            payloads: props.payloads
        }
    }

    render(){ 
        return(
            <div className="launch">

                <h2 className="launchTitle">{this.state.title}</h2>
                <h2 className="launchDate">{Moment(this.state.date).format('MMMM Do YYYY, h:mm:ss a')}</h2>
                <p className="desc">{this.state.desc}</p>
                <Payload payloads = {this.state.payloads}/>
            </div>
        );
    }
}
